import React from 'react'
import './ProjectItem.css'

const ProjectItem = (props) => {
    const {item} = props;

    return (
        <div className='container'>
            {item.url && <p>{item.url}</p>}
            <p>{item.title}</p>
            <div className=''>
                {item.github && 
                <a className="button link" href={item.github} target="_blank">GitHub</a>}
                {item.livedemo && 
                <a className='button link' href={item.livedemo} target="_blank">Page</a>}
            </div>
            <br></br>
            <p>{item.description}</p>
        </div>
    )
}

export default ProjectItem
